import React from 'react';

const ImageLinkForm = ({onInputChange, onSubmit}) => {
    return (
        <div>
            <p className='f3'>
                Give it a try!
            </p>
            <div>
                <input className="bg-gray" type='text' onChange={onInputChange} />
                <button className="link grow pointer" onClick={onSubmit}>Detect</button>
            </div>
        </div>
    );
}

export default ImageLinkForm
